// ----------------------------------------- Data Constants
const primaryKey = "primaryKey";


// ----------------------------------------- Utils

function parseString(str) {
    str = str.trim();
    str = str.toLowerCase();
    return str;
}


// ----------------------------------------- Trie Node

function TrieNode(key) {
    this.key = key;
    this.parent = null;
    this.children = {};
    this.end = false;
    this.data = []
}

TrieNode.prototype.getKey = function () {
    var output = [];
    var node = this;
    while (node !== null) {
        output.unshift(node.key);
        node = node.parent;
    }
    return output.join('');
};

TrieNode.prototype.getData = function () {
    var node = this;
    return node.data;
};

// ----------------------------------------- Trie Functions

function Trie() {
    this.root = new TrieNode(null);
}

Trie.prototype.insert = function (dataObj) {
    var node = this.root;
    var word = parseString(dataObj["key"]);
    for (var i = 0; i < word.length; i++) {
        if (!node.children[word[i]]) {
            node.children[word[i]] = new TrieNode(word[i]);
            node.children[word[i]].parent = node;
        }

        node = node.children[word[i]];

        if (i == word.length - 1) {
            node.end = true;
            node.data.push(dataObj["data"]);
        }
    }
};

Trie.prototype.contains = function (word) {
    word = parseString(word);
    var node = this.root;
    for (var i = 0; i < word.length; i++) {
        if (node.children[word[i]]) {
            node = node.children[word[i]];
        } else {
            return {"status": false};
        }
    }
    if (node.end) {
        return {"status": true, "result": node.data};
    }
    return {"status": false};
};

Trie.prototype.find = function (prefix, noOfTopResults) {
    prefix = parseString(prefix);
    var node = this.root;
    var output = [];
    for (var i = 0; i < prefix.length; i++) {
        if (node.children[prefix[i]]) {
            node = node.children[prefix[i]];
        } else {
            return output;
        }
    }
    findAllData(node, output, {});
    return getTopResults(output, noOfTopResults);
};

function findAllData(node, arr, uniqueData) {
    if (node.end) {
        var dataList = node.getData();
        for(var i=0; i < dataList.length; i++) {
            var data = dataList[i];
            if(!(data[primaryKey] in uniqueData)){
                arr.push(data);
                uniqueData[data[primaryKey]] = 1;
            }
        }
    }
    for (var child in node.children) {
        if (node.children.hasOwnProperty(child))
            findAllData(node.children[child], arr, uniqueData);
    }
}

function getTopResults(arr, noOfTopResults) {
    noOfTopResults = noOfTopResults || 10;
    if (arr.length > noOfTopResults)
        arr = arr.slice(0, noOfTopResults);
    return arr;
}


// ----------------------------------------- Data Related Function

function getPrimaryKey(length) {
    length = length || 7;
    var result = '';
    var characters = 'ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789';
    var charactersLength = characters.length;
    for ( var i = 0; i < length; i++ ) {
        result += characters.charAt(Math.floor(Math.random() * charactersLength));
    }
    return result;
}


// ----------------------------------------- Trie Creation

function createTrie(dataList, getKeys) {
    var trie = new Trie();
    // console.time("Trie Creation");
    for (var i = 0; i < dataList.length; i++) {
        var dataObj = dataList[i];
        var keys = getKeys(dataObj);
        dataObj[primaryKey] = getPrimaryKey();
        for (var j = 0; j < keys.length; j++) {
            try {
                if (typeof keys[j] == "undefined") continue;
                var trieNode = {
                    "key": keys[j],
                    "data": dataObj
                };
                trie.insert(trieNode);
            } catch(e){
            }

        }
    }
    // console.timeEnd("Trie Creation");
    return trie;
}
