function sortArrival() {
    var container = $('.flight-info-wrap');
    var items = $('.flight-cards');
    items.each(function() {
        var BCDate = $(this).attr('data-arrival');
        var standartDate = new Date(BCDate);
        $(this).attr('data-arrival', standartDate);
    });
    items
        .sort(function(a, b) {
            a = parseFloat($(a).attr('data-arrival'));
            b = parseFloat($(b).attr('data-arrival'));
            return a < b ? -1 : a > b ? 1 : 0;
        })
        .each(function() {
            container.prepend(this);
        });
}

function sortDeparture() {
    var container = $('.flight-info-wrap');
    var items = $('.flight-cards');
    items.each(function() {
        var BCDate = $(this).attr('data-departure');
        var standartDate = new Date(BCDate);
        $(this).attr('data-departure', standartDate);
    });
    items
        .sort(function(a, b) {
            a = parseFloat($(a).attr('data-departure'));
            b = parseFloat($(b).attr('data-departure'));
            return a < b ? -1 : a > b ? 1 : 0;
        })
        .each(function() {
            container.prepend(this);
        });
}

