var count = 0, maxFlightDayAttempts = 3;
function getFlightResponse(type) {

    var routeCarrier = $("#route-airline-name").attr('data-carrier');
    var flightCarrier = $("#flight-airline-name").attr('data-carrier');
    var date = new Date();
    if (!!type) {
        var url = API + "flightStats?type=" + type;

        if (type == 'route') {
            try{
                var depCode = !!flightDetails.depAirp.iataCode ? flightDetails.depAirp.iataCode :
                    flightDetails.depAirp.icaoCode;
                var arrCode = !!flightDetails.arrAirp.iataCode ? flightDetails.arrAirp.iataCode :
                    flightDetails.arrAirp.icaoCode;
            }catch (err) {

            }

            url += "&day=" + byRouteDepartureDate.day;
            url += "&month=" + byRouteDepartureDate.month;
            url += "&year=" + byRouteDepartureDate.year;
            url += "&hourOfDay=" + byRouteDepartureDate.hour;
            url += "&utc=true&numHours=24&maxFlights=100";
            url += "&depAirp=" + depCode;
            url += "&arrAirp=" + arrCode;
            url += "&carrier=" + routeCarrier;
        } else if (type == 'flight') {
            url += "&day=" + byFlightdepartureDate.day;
            url += "&month=" + byFlightdepartureDate.month;
            url += "&year=" + byFlightdepartureDate.year;
            url += "&flight=" + $("#flight-number").val();
            url += "&carrier=" + flightCarrier;
            url += "&hourOfDay=" + date.getUTCHours();
            url += "&utc=false&numHours=24&maxFlights=20";
        }
    }

    try {
        $.ajax({
            url: url,
            type: 'GET',
            dataType: 'json',
            beforeSend: function(){
                flightfound();
            },
            success: function(response) {
                if (!!response.flightStatuses && response.flightStatuses.length > 0) {
                    if (type == 'route') {
                        var hasStatus = false;
                        for(var i = 0 ; i < response.flightStatuses.length; i++){
                            if(response.flightStatuses[i].hasOwnProperty("status") && response.flightStatuses[i].status !== "L") {
                                hasStatus = true;
                            }
                        }
                        if(hasStatus){
                            showRouteCards(response);
                        }else{
                            getNextDaysFlights()
                        }
                    } else if (type == 'flight') {
                        showFlightCards(response);
                    }
                    $(".flight-info-wrap").removeClass('no-flights');
                    $(".track-flight-content").removeClass('no-flights');
                } else {
                    if(count<maxFlightDayAttempts){
                        count++;
                        if (type == 'route') {
                            getNextDaysFlights()
                        }else{
                            $(".flight-info-wrap").addClass('no-flights');
                            $(".track-flight-content").addClass('no-flights');
                            $(".flight-info-wrap").text('No flights found');
                            count = 0;
                        }
                    }else{
                        $(".flight-info-wrap").addClass('no-flights');
                        $(".track-flight-content").addClass('no-flights');
                        $(".flight-info-wrap").text('No flights found');
                        count = 0;
                    }
                }
            },
            error: function(error) {
                console.log(error);
            }
        });
    } catch (err) {
        console.log(err);
    }
}

function getNextDaysFlights(){

    try{
        var flightDate = new Date(byRouteDepartureDate['currentDate'].getTime() + 24 * 60 * 60 * 1000);
        showRoute(flightDate, false);
    }catch(e){
        $(".flight-info-wrap").addClass('no-flights');
        $(".track-flight-content").addClass('no-flights');
        $(".flight-info-wrap").text('No flights found');
        noflightfound();
        count = 0;
    }

}

