function _setDate() {
     setInterval(function() {
        timeUpdateInDom();
    }, 1000);
}
function timeUpdateInDom(){
    document.querySelector('#cust_date').textContent = _getTimeAndDate().date;
    document.querySelector('#cust_time').textContent = _getTimeAndDate().time;
}

function _changeTimeFormatTo12Hr(date) {
    var hours = date.getHours(),
        minutes =
            date.getMinutes() < 10
                ? '0' + date.getMinutes()
                : date.getMinutes();
    var unit = _getMeridianFromHour(hours);
    hours = hours % 12;
    hours = hours == 0 ? 12 : hours;

    return {
        hours: hours,
        minutes: minutes,
        unit: unit
    };
}

function _getMeridianFromHour(hour) {
    hour = hour % 24;
    return hour < 12 ? 'am' : 'pm';
}

function _getTimeAndDate() {
    var obj = {};
    var monthNames = [
        'January',
        'February',
        'March',
        'April',
        'May',
        'June',
        'July',
        'August',
        'September',
        'October',
        'November',
        'December'
    ];
    var wekdayName = [
        'Sunday',
        'Monday',
        'Tuesday',
        'Wednesday',
        'Thursday',
        'Friday',
        'Saturday'
    ];
    var date = new Date();
    obj.date = (
        wekdayName[date.getDay() + 0] +
        ', ' +
        monthNames[date.getMonth() + 0] +
        ' ' +
        date.getDate()
    ).toString();
    obj.time = (
        _changeTimeFormatTo12Hr(date).hours +
        ':' +
        _changeTimeFormatTo12Hr(date).minutes +
        ' ' +
        _changeTimeFormatTo12Hr(date).unit
    ).toString();
    return obj;
}

